import React from "react";
/** @jsx jsx */
import { css, jsx } from "@emotion/core";

import Project from "./Project";

export default class ProjectGallery extends React.Component {
  render() {
    return (
      <div
        css={css`
          width: 100%;
          overflow-x: scroll;
          align-items: stretch;
        `}
      >
        <Project
          name="dailybruin.com"
          flavor="a polling platform that allows you to generate and share polls all around the world"
          image={
            "https://wp.dailybruin.com/images/2020/06/web.breaking.AL_.jpg"
          }
        ></Project>
        <Project></Project>
        <Project></Project>
      </div>
    );
  }
}
